import { StyledBoxModal, StyledModal } from "./style";
import { VscChromeClose } from "react-icons/vsc";

export const Modal = ({ title, setModal }) => {
  return (
    <StyledModal>
      <StyledBoxModal>
        <header>
          <h2>{title}</h2>
          <button onClick={() => setModal(false)}>
            <VscChromeClose />
          </button>
        </header>
      </StyledBoxModal>
    </StyledModal>
  );
};
